&lt;p&gt;&lt;a href="http://www.flickr.com/photos/marcp_dmoz/4443062552/" title="House of Shells – Casa de las Conchas, Salamanca (Spain) HDR"&gt;&lt;img src="http://farm5.static.flickr.com/4012/4443062552_697b5b79e5_m.jpg" width="240" height="198" alt="House of Shells – Casa de las Conchas, Salamanca (Spain) HDR" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;Built at the end of the fifteenth century by Rodrigo Arias de Maldonado, a knight of the order of Santiago, this city palace is decorated with more than 300 scallop shells. The shells on the front of the house allude to that order since the scallop shell is traditionally associated with St. James--Santiago (bluffton.edu).&lt;br /&gt;
Today it's a public library.&lt;br /&gt;
&lt;br /&gt;
HDR from five bracketed exposures (1EV steps), on a tripod.&lt;br /&gt;
&lt;br /&gt;
-------------------------&lt;br /&gt;
&lt;br /&gt;
La Casa de las Conchas de Salamanca es un edificio de estilo gótico y elementos platerescos. Su construcción se inicia en 1493. En el interior destacan el patio con arcos mixtilíneos, la escalera y el artesonado (Wikipedia).&lt;br /&gt;
&lt;br /&gt;
