&lt;p&gt;Desde nuestro antiguo &amp;quot;Puente Nuevo&amp;quot; ó &amp;quot;Puente de Hierro&amp;quot; ó &amp;quot;Puente Enrique Estevan&amp;quot;, hay unas vistas preciosas de Salamanca. En este caso no es la típica de la catedral reflejada en el río. Esta es una aceña que remansaba el agua para llevarla al molino, hoy hotel y casino (iluminado). En el centro edificios de la Facultad de Ciencias.&lt;br /&gt;
&lt;br /&gt;
Since our old &amp;quot;New Bridge&amp;quot; or &amp;quot;Iron Bridge&amp;quot; or &amp;quot;Bridge Enrique Estevan, there are wonderful views of Salamanca. In this case is not typical of the cathedral reflected in the river. &amp;quot; This is a watermill which sweeped the water and carry to the mill hotel and casino today (lit). At the core buildings of the Faculty of Sciences.&lt;br /&gt;
&lt;br /&gt;
