&lt;p&gt;Para el visitante-turista estar en Salamanca y no ver la rana es... un pecado.&lt;br /&gt;
&lt;br /&gt;
A mi siempre me ha recordado al PADRE PUTAS, historia que me contó hace mucho tiempo mi abuelo..., se me olvidó decir que al parecer el mencionado PADRE PUTAS  era un clérigo...&lt;br /&gt;
&lt;br /&gt;
&amp;quot;El &amp;quot;lunes de Aguas&amp;quot; es una fiesta que se celebra el lunes siguiente al de Pascua en Salamanca.&lt;br /&gt;
&lt;br /&gt;
Los orígenes se remontan al siglo XVI, cuando el rey Felipe II dicta unas ordenanzas según las cuales las prostitutas que habitaban en la Casa de Mancebía local debían ser trasladadas, durante la Cuaresma, fuera de la ciudad, para que los hombres de Salamanca, sin la presencia de busconas, evitasen las tentaciones del pecado de lujuria. &lt;br /&gt;
&lt;br /&gt;
A partir del Miércoles de Ceniza dichas meretrices eran trasladadas al Arrabal del puente, al otro lado del río Tormes. &lt;br /&gt;
&lt;br /&gt;
Hasta el primer lunes después del de Pascua permanecían bajo la custodia del Padre Putas. En esta fecha éste las conducía de vuelta a la ciudad, vitoreado por una multitud de estudiantes que no ahorraban en hornazo ( especie de empanada que se elabora para esta ocasión), bebida y bailes para celebrar la llegada de estas cortesanas con una fiesta en las riberas del Tormes y en barcas engalanadas.&amp;quot;&lt;br /&gt;
&lt;br /&gt;
(Sacado en parte de Wikipedia)&lt;/p&gt;

