Conserva parte de su primitiva traza románica, como el ábside con tres ventanas abocinadas y la cornisa con decoración escultórica: rostros, animales y una escena musical. En el interior, de una sola nave y presbiterio cubierto con la bóveda original de cañón apuntado, se conservan imágenes de la Virgen con el Niño, otra de la Virgen con el Rosario y una ultima de San Juan Bautista. Esta iglesia sufrió una importante transformación en el siglo XVIII, barroquizando su estilo original. Entre sus obras de arte, destaca el Cristo de la Zarza, del siglo XII, de dos metros de altura y realizado en madera de nogal.&lt;br /&gt;
Se cuenta que en esta iglesia predicó San Vicente Ferrer. &lt;br /&gt;
