&lt;p&gt;Como sólo tengo algunos datos  prefiero pegar de internet y deciros de donde salió.&lt;br /&gt;
&lt;br /&gt;
&amp;quot;En la Puerta de Ramos de la catedral nueva de Salamanca, construida entre los siglos XVI y XVIII, puede verse un astronauta labrado en piedra durante una restauración hecha en 1992 por el cantero Miguel Romero, mientras que una de las gárgolas que se repusieron en los años veinte en la catedral de Palencia (siglo XIV) representa a un fotógrafo.&lt;br /&gt;
&lt;br /&gt;
&lt;br /&gt;
Del mismo modo, en una restauración hecha en 1996 en la catedral riojana de Calahorra (siglo XVII) se labró un teléfono móvil y en otra llevada a cabo en el siglo XIX en la Casa del Arcediano de Barcelona (siglo XII) se esculpieron dos burgueses del XIX: una damisela y un señor con sombrero de copa que la saluda. Aunque quizá el caso más llamativo sea el de la iglesia de Santa María la Mayor de la localidad cacereña de Trujillo (siglo XIII), donde el cantero Antonio Serván labró durante una restauración hecha en 1972 el escudo del equipo de fútbol del que era seguidor: el Athletic de Bilbao.&amp;quot;&lt;br /&gt;
&lt;br /&gt;
Tomado de El Diario de Navarra.&lt;/p&gt;

