&lt;p&gt;Pasear y disfrutar un violinista que hacía las delicias de los que pasábamos por aquella calle sin centrarnos sólo en nuestras cosas...&lt;br /&gt;
&lt;br /&gt;
Pasear de nuevo horas más tardes y descubrir que fue sólo un sueño al alcance de aquellos que supimos buscar los ojos del corazón de &lt;a href="http://www.goear.com/listen/adc26f1/bso-esencia-de-mujer-thomas-newman" rel="nofollow"&gt;aquella música&lt;/a&gt; de la que ahora sólo quedaba un puñado de flores, una silla vacía y aquel viejo violín que espera que cierres tus ojos de nuevo...&lt;br /&gt;
&lt;br /&gt;
PD: Allí dónde estés..gracias por aquella música...gracias a los que arrancáis notas a las esquinas de nuestras calles, de nuestros soportales, con arte y tocando el corazón, poniendo algo de banda sonora a nuestros días... ¿bailas?&lt;/p&gt;

