&lt;p&gt;Salamanca is known both for its monumental sights and the University of Salamanca, which was founded in 1218 and is the oldest university in Spain and the fifth oldest western university. With its 30,000 students, the university is, together with tourism, the economic engine of the city. Salamanca is also known for the teaching of the Spanish language; in this field, Salamanca supplies 16% of the market within Spain and attracts thousands of foreign students (Wikipedia).&lt;br /&gt;
&lt;br /&gt;
-----------------------------------------------------------------------------------------------------------------------&lt;br /&gt;
&lt;br /&gt;
En 1988 la ciudad fue declarada Patrimonio de la Humanidad por la Unesco. Cuenta con un importante patrimonio arquitectónico, entre el que destacan sus dos catedrales, la Catedral Vieja y la Nueva, la Casa de las Conchas, la Plaza Mayor, el Convento de San Esteban y las Escuelas Mayores. Desde 2003, la Semana Santa en Salamanca está declarada de Interés Turístico Internacional (Wikipedia).&lt;/p&gt;

