&lt;br /&gt;
Tras recorrer más de 6300km, la cámara se ha llenado de unos cuantos miles de fotos, de las cuales tendré que elegir unas pocas para compartir con vosotros.&lt;br /&gt;
&lt;br /&gt;
Todo empezó en Salamanca, en esta estación de tren. ¡Partamos!&lt;/p&gt;

