&lt;p&gt;&lt;a href="http://www.flickr.com/photos/jaroro70/4964027511/" title="Venceréis, pero no convenceréis..."&gt;&lt;img src="http://farm5.static.flickr.com/4112/4964027511_f5d0c7a823_m.jpg" width="240" height="163" alt="Venceréis, pero no convenceréis..." /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;Corría el 12 de octubre de 1936.  Durante la apertura del curso académico (y con la plana mayor franquista presente) se celebraron en el paraninfo de la Universidad de Salamanca diversos actos para conmemorar &amp;quot;el Día de la Raza&amp;quot;.&lt;br /&gt;
&lt;br /&gt;
El acto estaba presidido por un gran cuadro de Franco y estaban presentes su esposa, Carmen Polo, el obispo de Salamanca y las autoridades locales. Ante un auditorio enfervorizado, el general Millán Astray afirmó: “Los catalanes y los vascos son cánceres en el cuerpo de la nación. El cirujano de hierro que es el fascismo sabrá como extirparlos y lo hará cortando en carne viva, sin escrúpulos, ni falsos sentimentalismos”. &lt;br /&gt;
&lt;br /&gt;
De entre el público se escuchó entonces el grito que expresaba el lema favorito del general: “¡Viva la muerte!”. Fue en aquel momento en el que Unamuno, a quién correspondía la palabra, se levantó con lentitud y, calmado el público, comenzó a hablar: &lt;br /&gt;
&lt;br /&gt;
&lt;i&gt;“Sé que estáis esperando mis palabras con verdadera expectación e interés. Me conocéis bien y sabéis que soy incapaz de permanecer en silencio. &lt;b&gt;Muchas veces callar equivale a mentir, porque el silencio puede ser interpretado como complicidad. &lt;/b&gt;&lt;br /&gt;
&lt;br /&gt;
Hace un momento he escuchado el necrófilo e insensato grito de “Viva la muerte”. El general Millan Astray es un inválido. Él es un inválido de verdad. También lo fue Cervantes. Pero desgraciadamente hay hoy en España demasiados mutilados y si Dios no lo remedia pronto habrá muchísimos más. Me sobrecoge el pensar que el general Millan Astray pudiera algún día dictar leyes y normas. Un mutilado que carezca de la grandeza espiritual de Cervantes es hasta cierto punto lógico que encuentre un terrible alivio a su situación viendo cómo en torno suyo se multiplican los mutilados”.&lt;/i&gt;&lt;br /&gt;
&lt;br /&gt;
En aquel instante, el general se levantó violentamente, golpeó con furor la mesa con su única mano y exclamó: &lt;i&gt;“¡Abajo los intelectuales! ¡Viva la muerte! &lt;/i&gt;&lt;br /&gt;
&lt;br /&gt;
Unamuno hizo otra pausa, esperó a que cesasen los gritos y con voz lenta concluyó:&lt;i&gt; “Éste es el templo de la inteligencia. Y yo, aquí donde me veis, soy sumo sacerdote. Estáis pues profanando su sagrado recinto. Y debo además deciros lo siguiente: &lt;b&gt;Venceréis, que duda cabe, porque tenéis la razón de la fuerza, pero nunca podréis convencer, porque para convencer hay que persuadir, y para persuadir, carecéis de los más elemental: de la fuerza de la razón y del derecho. Nada más: me parece inútil persuadiros que penséis en España. He dicho”.&lt;/b&gt;&lt;br /&gt;
&lt;br /&gt;
Su &amp;quot;descortesía rencorosa&amp;quot; fue penalizada con un arrestro domiciliario. Nunca más volvió a salir de sus casa. Murió cuatro meses después. A la postre, esas fueron las últimas palabras en público del intelectual, pero han quedado grabadas para la historia...&lt;br /&gt;
&lt;/i&gt;&lt;br /&gt;
