&lt;p&gt;&lt;a href="http://www.flickr.com/photos/14228038@N06/4970650586/" title="FIESTA DE SALAMANCA en honor a la Virgen de la Vega"&gt;&lt;img src="http://farm5.static.flickr.com/4125/4970650586_9ab76f032d_m.jpg" width="240" height="179" alt="FIESTA DE SALAMANCA en honor a la Virgen de la Vega" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;El 8 de Septiembre, se celebra la Virgen de la Vega, patrona de Salamanca.&lt;br /&gt;
La vispera, se realiza una ofrenda floral, ataviados con los ricos trajes charros, se desfila por el casco antiguo .&lt;br /&gt;
En el atrio de la catedral, se realiza la ofrenda.&lt;br /&gt;
Después la ciudad se ilumina con unos fuegos de artificio, que se superan cada año.&lt;br /&gt;
Hoy se celebra la Misa solemne en la Catedral, cantada por nuestro coro, por lo que parto para allá en unos instantes.&lt;/p&gt;

