&lt;p&gt;La Catedral Nueva, adosada a la Vieja, se comenzó a construir en 1513, y en 1733 se inaugura y consagra solemnemente. En la promoción inicial intervinieron los Reyes Católicos, a petición del Cabildo Catedral, que, con los obispos sucesivos, actuó siempre como principal promotor.&lt;br /&gt;
