&lt;p&gt;&lt;a href="http://www.flickr.com/photos/jaroro70/4981471771/" title="Como decíamos ayer..."&gt;&lt;img src="http://farm5.static.flickr.com/4107/4981471771_43abd54059_m.jpg" width="240" height="164" alt="Como decíamos ayer..." /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;Hacía una mañana fría y el aire gélido de Salamanca cortaba su rostro y entrecortaba su respiración. Era muy temprano, la calle libreros estaba desierta y en ella, tan solo se escuchaba el eco del golpeteo cadente de sus sandalias contra el adoquinado suelo. Fray Luis tenía prisa. Quería llegar cuanto antes a su clase de Filosofía. Quería reencontrarse con su alumnado y con la normalidad. &lt;br /&gt;
&lt;br /&gt;
Atrás quedaron 3 largos años de cautiverio en el penal de Valladolid. Demasiados odios, demasiadas envidias entre sus compañeros de profesión habían dado con sus huesos en la cárcel . Quería dejar todo eso atrás. Quería olvidarlo todo.&lt;br /&gt;
&lt;br /&gt;
Casi sin darse cuenta, había llegado a la universidad. Suspiró tranquilo, estaba en casa. Era para él su gran momento.  Abrió la puerta con decisión y entró con paso firme al aula. Por el rabillo del ojo observó como todo su alumnado estaba esperándolo en silencio, sentados, expectantes.&lt;br /&gt;
&lt;br /&gt;
Él, como cualquier otro día, dejó los libros con delicadeza sobre la mesa, se acomodó el hábito y levantando lentamente su mirada se dirigió a sus discípulos:&lt;br /&gt;
&lt;br /&gt;
&amp;quot;&lt;i&gt;Como decíamos ayer...&lt;/i&gt;&amp;quot;&lt;br /&gt;
