&lt;p&gt;I was curious about those letters or graffitis that we can see in some buildings around Salamanca University. They say that during the 16th and 17th century there was a kind of fiesta (party) that included a bullfight after the final exams. Those who passed their graduation used a special ink made with the blood of the bull to write their names or a &amp;quot;V&amp;quot; (from Victory) on the university's walls.&lt;/p&gt;

