&lt;p&gt;On the rather long drive from Sevilla to Burgos we stopped in Salamanca for lunch. This is the Plaza Mayor which featured heavily in the film &amp;quot;Vantage Point&amp;quot;.&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/estress/"&gt;Estress&lt;/a&gt; posted a photo:&lt;/p&gt;

