&lt;p&gt;El río Tormes y la catedral de Salamanca desde el puente Enrique Estevan. Para esta toma se usó un gran angular Tokina 11-16.&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/jaroro70/"&gt;jaroro70&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/jaroro70/4995397768/" title="Los tres coños"&gt;&lt;img src="http://farm5.static.flickr.com/4083/4995397768_2fc13c94e6_m.jpg" width="240" height="162" alt="Los tres coños" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;Este lugar es conocido en Salamanca como la plaza de los &amp;quot;3 coños&amp;quot;.  Yo solamente he podido comprobar in situ dos:  ¡coño que bonito! ¡coño que alto! y he dejado para otra ocasión el que me falta: ¡coño que frío! (por lo visto, en invierno en este cruce de calles corre una corriente de aire [sin nombre] congelado que te deja tiritando para todo el día). El &amp;quot;coño que alto&amp;quot; se debe a la Clerecía (a la izquierda en la imagen) y el &amp;quot;coño que bonito&amp;quot; porque, efectivamente, el conjunto de la Casa de las Conchas, la Clerecía y el palacio de Monterrey al fondo hacen del conjunto un entorno precioso difícil de olvidar.&lt;br /&gt;
